const root = document.getElementById("root");

if (root) {
  root.innerHTML = "Hello";
}
ReactDOM.createRoot(root).render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);
